Language Japanese 
Subtitles Chinese    
Release Date  1983
Category  Classic, Asian
Director  Masaru Konuma
Starring  Ryousei Tayama, Matsukawa Nami, Shima Izumi, Senba Kazuyuki 

Sayo Mayuzumi runs a successful traveling S&amp;M show with her husband. Tired of her 
life, she decides to quit the business and leave her husband. But on their latest tour, 
they perform a private showing for a strange man who ends up teaching them true 
happiness of life.
